import { Component } from '@angular/core';
import { Pessoa } from '../pessoa/pessoa';


@Component({
  selector: 'app-listagem-pessoas',
  templateUrl: './listagem-pessoas.component.html',
  styleUrls: ['./listagem-pessoas.component.scss']
})
export class ListagemPessoasComponent {

  pessoa: Pessoa[] = [
    new this.Pessoa('João', 20),
    new this.Pessoa('Maria', 25),
    new this.Pessoa('Pedro', 30),
    new this.Pessoa('Paulo', 35),
    new this.Pessoa('José', 40),
    new this.Pessoa('Ana', 45),
    new this.Pessoa('Carlos', 50),
    new this.Pessoa('Cristina', 55),
    new this.Pessoa('Lucas', 60),

  ];

  constructor() { }



}
